@DesmondSwayne WHAT?!?

OF COURSE we bloody care! We've been jumping up and down with frustrated rage at the way our liberties have been set aside, but none of you lot ever bloody listens!

&lt;ahem&gt;

...and we're far too polite to cause a big stink about it. But we're bloody annoyed.

@SeanOMa50505961 @martian_rage Difference between saying “please can you be mindful of your words” and “or go to prison!” Though. 🤗

If you are rude and offensive about my body for example - I just won’t like you, I don’t want you to go to jail 🤣

But personally identifying ppl on the internet is different.

@BethMooreLPM Psalm 2 (put to music in Handel’s Messiah): ‘Why do the people so furiously rage together’

I guess human nature is very SLOW to change.

‘What, then, shall we say in response to this? If God is for us, who can be against us?’ Rom 8:31
